func (cq *CabinetQuery) sqlCount(ctx context.Context) (int, error) {
	_spec := cq.querySpec()
	if len(cq.modifiers) > 0 {
		_spec.Modifiers = cq.modifiers
	}
	_spec.Node.Columns = cq.ctx.Fields
	if len(cq.ctx.Fields) > 0 {
		_spec.Unique = cq.ctx.Unique != nil && *cq.ctx.Unique
	}
	return sqlgraph.CountNodes(ctx, cq.driver, _spec)
}

func (cq *CabinetQuery) querySpec() *sqlgraph.QuerySpec {
	_spec := &sqlgraph.QuerySpec{
		Node: &sqlgraph.NodeSpec{
			Table:   cabinet.Table,
			Columns: cabinet.Columns,
			ID: &sqlgraph.FieldSpec{
				Type:   field.TypeUint64,
				Column: cabinet.FieldID,
			},
		},
		From:   cq.sql,
		Unique: true,
	}
	if unique := cq.ctx.Unique; unique != nil {
		_spec.Unique = *unique
	}
	if fields := cq.ctx.Fields; len(fields) > 0 {
		_spec.Node.Columns = make([]string, 0, len(fields))
		_spec.Node.Columns = append(_spec.Node.Columns, cabinet.FieldID)
		for i := range fields {
			if fields[i] != cabinet.FieldID {
				_spec.Node.Columns = append(_spec.Node.Columns, fields[i])
			}
		}
	}
	if ps := cq.predicates; len(ps) > 0 {
		_spec.Predicate = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	if limit := cq.ctx.Limit; limit != nil {
		_spec.Limit = *limit
	}
	if offset := cq.ctx.Offset; offset != nil {
		_spec.Offset = *offset
	}
	if ps := cq.order; len(ps) > 0 {
		_spec.Order = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	return _spec
}

func (cq *CabinetQuery) sqlQuery(ctx context.Context) *sql.Selector {
	builder := sql.Dialect(cq.driver.Dialect())
	t1 := builder.Table(cabinet.Table)
	columns := cq.ctx.Fields
	if len(columns) == 0 {
		columns = cabinet.Columns
	}
	selector := builder.Select(t1.Columns(columns...)...).From(t1)
	if cq.sql != nil {
		selector = cq.sql
		selector.Select(selector.Columns(columns...)...)
	}
	if cq.ctx.Unique != nil && *cq.ctx.Unique {
		selector.Distinct()
	}
	for _, m := range cq.modifiers {
		m(selector)
	}
	for _, p := range cq.predicates {
		p(selector)
	}
	for _, p := range cq.order {
		p(selector)
	}
	if offset := cq.ctx.Offset; offset != nil {
		// limit is mandatory for offset clause. We start
		// with default value, and override it below if needed.
		selector.Offset(*offset).Limit(math.MaxInt32)
	}
	if limit := cq.ctx.Limit; limit != nil {
		selector.Limit(*limit)
	}
	return selector
}

// Modify adds a query modifier for attaching custom logic to queries.
func (cq *CabinetQuery) Modify(modifiers ...func(s *sql.Selector)) *CabinetSelect {
	cq.modifiers = append(cq.modifiers, modifiers...)
	return cq.Select()
}

type CabinetQueryWith string

var (
	CabinetQueryWithCity         CabinetQueryWith = "City"
	CabinetQueryWithBranch       CabinetQueryWith = "Branch"
	CabinetQueryWithModels       CabinetQueryWith = "Models"
	CabinetQueryWithFaults       CabinetQueryWith = "Faults"
	CabinetQueryWithExchanges    CabinetQueryWith = "Exchanges"
	CabinetQueryWithStocks       CabinetQueryWith = "Stocks"
	CabinetQueryWithBatteries    CabinetQueryWith = "Batteries"
	CabinetQueryWithBatteryFlows CabinetQueryWith = "BatteryFlows"
)

func (cq *CabinetQuery) With(withEdges ...CabinetQueryWith) *CabinetQuery {
	for _, v := range withEdges {
		switch v {
		case CabinetQueryWithCity:
			cq.WithCity()
		case CabinetQueryWithBranch:
			cq.WithBranch()
		case CabinetQueryWithModels:
			cq.WithModels()
		case CabinetQueryWithFaults:
			cq.WithFaults()
		case CabinetQueryWithExchanges:
			cq.WithExchanges()
		case CabinetQueryWithStocks:
			cq.WithStocks()
		case CabinetQueryWithBatteries:
			cq.WithBatteries()
		case CabinetQueryWithBatteryFlows:
			cq.WithBatteryFlows()
		}
	}
	return cq
}

// CabinetGroupBy is the group-by builder for Cabinet entities.
type CabinetGroupBy struct {
	selector
	build *CabinetQuery
}

// Aggregate adds the given aggregation functions to the group-by query.
func (cgb *CabinetGroupBy) Aggregate(fns ...AggregateFunc) *CabinetGroupBy {
	cgb.fns = append(cgb.fns, fns...)
	return cgb
}

// Scan applies the selector query and scans the result into the given value.
func (cgb *CabinetGroupBy) Scan(ctx context.Context, v any) error {
	ctx = setContextOp(ctx, cgb.build.ctx, "GroupBy")
	if err := cgb.build.prepareQuery(ctx); err != nil {
		return err
	}
	return scanWithInterceptors[*CabinetQuery, *CabinetGroupBy](ctx, cgb.build, cgb, cgb.build.inters, v)
}

func (cgb *CabinetGroupBy) sqlScan(ctx context.Context, root *CabinetQuery, v any) error {
	selector := root.sqlQuery(ctx).Select()
	aggregation := make([]string, 0, len(cgb.fns))
	for _, fn := range cgb.fns {
		aggregation = append(aggregation, fn(selector))
	}
	if len(selector.SelectedColumns()) == 0 {
		columns := make([]string, 0, len(*cgb.flds)+len(cgb.fns))
		for _, f := range *cgb.flds {
			columns = append(columns, selector.C(f))
		}
		columns = append(columns, aggregation...)
		selector.Select(columns...)
	}
	selector.GroupBy(selector.Columns(*cgb.flds...)...)
	if err := selector.Err(); err != nil {
		return err
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := cgb.build.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

// CabinetSelect is the builder for selecting fields of Cabinet entities.
type CabinetSelect struct {
	*CabinetQuery
	selector
}

// Aggregate adds the given aggregation functions to the selector query.
func (cs *CabinetSelect) Aggregate(fns ...AggregateFunc) *CabinetSelect {
	cs.fns = append(cs.fns, fns...)
	return cs
}

// Scan applies the selector query and scans the result into the given value.
func (cs *CabinetSelect) Scan(ctx context.Context, v any) error {
	ctx = setContextOp(ctx, cs.ctx, "Select")
	if err := cs.prepareQuery(ctx); err != nil {
		return err
	}
	return scanWithInterceptors[*CabinetQuery, *CabinetSelect](ctx, cs.CabinetQuery, cs, cs.inters, v)
}

func (cs *CabinetSelect) sqlScan(ctx context.Context, root *CabinetQuery, v any) error {
	selector := root.sqlQuery(ctx)
	aggregation := make([]string, 0, len(cs.fns))
	for _, fn := range cs.fns {
		aggregation = append(aggregation, fn(selector))
	}
	switch n := len(*cs.selector.flds); {
	case n == 0 && len(aggregation) > 0:
		selector.Select(aggregation...)
	case n != 0 && len(aggregation) > 0:
		selector.AppendSelect(aggregation...)
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := cs.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

// Modify adds a query modifier for attaching custom logic to queries.
func (cs *CabinetSelect) Modify(modifiers ...func(s *sql.Selector)) *CabinetSelect {
	cs.modifiers = append(cs.modifiers, modifiers...)
	return cs
}
